import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import PDF from "./PDF";

const App = () => {
    return (
        <Router>
            <div className="App">
                <ScrollToTop />
                <Navbar />
                <Routes>
                    <Route exact path="/" element={() => <PDF title={"test.pdf"} />} />

                </Routes>
            </div>
        </Router>
    );
};

export default App;
